import React, { Component } from "react";
const RadioInput = ({ type, id, name, value, checked, onChange }) => {
  return (
    <div>
      <input
        type={type}
        id={id}
        name={name}
        value={value}
        checked={checked}
        onChange={onChange}
      />
    </div>
  );
};

export default RadioInput;
